import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import { ChakraProvider } from "@chakra-ui/react";

const App = () => {
  return (
    <ChakraProvider>
      <Header />
      <Footer />
    </ChakraProvider>
  );
};

export default App;
